import { Link } from "react-router-dom";
import styles from "./MobileMenu.module.scss";
import { useContext } from "react";
import { AuthContext } from "../../../context";

export default function MobileMenu() {
  const { signout, user } = useContext(AuthContext);
console.log();
  return (
    <div className={`card ${styles.menuContainer} `}>
      {user.user ? (
        <div className="d-flex justify-content-between">
          <div>
            <Link to="/" className="decoNone">
              <button className="d-flex justify-content-center align-items-center las la-home la-2x btn-primary"></button>
            </Link>
          </div>
          <div>
            <Link onClick={() => signout()} className="decoNone">
              <button
                className={`las la-sign-out-alt la-2x d-flex justify-content-center align-items-center btn-primary-reverse`}
              ></button>
            </Link>
          </div>
        </div>
      ) : (
        <div className="d-flex justify-content-between">
          <div>
            <Link to="/" className="decoNone">
              <button className="d-flex justify-content-center align-items-center las la-home la-2x btn-primary"></button>
            </Link>
          </div>
          <div>
            <Link to="/signin" className="decoNone">
              <button className="d-flex justify-content-center align-items-center las la-sign-in-alt la-2x btn-primary"></button>
            </Link>
          </div>
        </div>
      )}
    </div>
  );
}
